import NavbarComponent from "../components/Navbar";
import SidebarComponent from "../components/Sidebar";


const CategoriesPage = () => {
    //data
    const data = [
        {
            "C": "Category 1",
            "mobile no": "0000000000",
            "age": "22",
            "gender": "male"
        },
        {
            "name": "Category 2",
            "mobile no": "1111111111",
            "age": "30",
            "gender": "male"
        },
        {
            "name": "Category 3",
            "mobile no": "2222222222",
            "age": "19",
            "gender": "female"
        },
        {
            "name": "Category 4",
            "mobile no": "1111111111",
            "age": "30",
            "gender": "male"
        },
        {
            "name": "Category 5",
            "mobile no": "2222222222",
            "age": "19",
            "gender": "female"
        }
    ];

    // return
    return (
        <>
            <NavbarComponent />
            <SidebarComponent now={'categories'} />
            <div className="w-10/12 min-h-screen px-3 pt-16 ml-80">
                <div className="w-full min-h-screen bg-gray-200 rounded-lg px-5 py-5  mt-3">
                    {/* Table */}
                    <div className="w-full bg-gray-100">
                        <table className="w-full table-auto border-collapse border border-gray-400">
                            <thead>
                                <tr>
                                    {Object.keys(data[0]).map((key) => (
                                        <th key={key} className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                            {key}
                                        </th>
                                    ))}
                                </tr>
                            </thead>
                            <tbody>
                                {data.map((item, index) => (
                                    <tr key={index}>
                                        {Object.values(item).map((value, subIndex) => (
                                            <td key={subIndex} className="border text-sm text-md border-gray-300 px-4 py-2">
                                                {value}
                                            </td>
                                        ))}
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                    {/* Table */}
                </div>
            </div>
        </>
    );
}

export default CategoriesPage;
